import React from "react";

export default function NoteItem({ note, onEditClick, onDeleteClick }) {
  return (
    <div className="border rounded-md p-4 shadow-sm mb-4">
      <h3 className="font-bold text-lg">{note.title}</h3>
      <p className="text-gray-700">{note.description}</p>
      <div className="flex justify-end mt-2 space-x-4">
        {/* Edit Icon */}
        <i
          className="fa-solid fa-file-pen text-teal-500 hover:text-teal-600 cursor-pointer"
          onClick={() => onEditClick(note)} // Trigger edit functionality
        ></i>

        {/* Delete Icon */}
        <i
          className="fa-solid fa-trash text-red-500 hover:text-red-600 cursor-pointer"
          onClick={() => onDeleteClick(note._id)} // Trigger delete functionality
        ></i>
      </div>
    </div>
  );
}
